import React from "react";
import "./main.css"
import GoodsCard from "../GoodsCard/GoodsCard";


const Main = () =>{
    return (
        <div className="main">
         <div className="main-wrapper">
            <div className="goods-wrapper">
                <GoodsCard goodsname="xui" goodsdiscripion="Это огромный железный хуй для всей твоей семьи со скидкой 99%"/>
            </div>
         </div>
        </div>
    );
}

export default Main;
